import { Component } from "react";

class Pavani extends Component{
    constructor(props){
        super(props)
        this.state={
            id:1,
            book:"javascript",
            author:"pavani"

        }
    }
    change=()=>{
        this.state({
            id:2,
            book:"react js",
            author:"raghav"
        })
    }
    render(){
        return(
            <div>
                
                id:{this.state.id}<br/>
                book:{this.state.book}<br/>
                author:{this.state.author}<br/>
                <button onClick={this.change}>update</button>

            </div>
        )
    }
}
export  default Pavani;
